import axios from 'axios';

const proxyURL = 'https://cors-anywhere.herokuapp.com';

const headers = {
    'Content-Type': 'application/json',
    Accept: 'application/json',
    'Access-Control-Allow-Origin': '*'
};

const api = axios.create({
    baseURL: `http://52.45.128.89`,
    headers: headers
});

export default api;
